import Navbar from "./Navbar";
import { useAuth0 } from "@auth0/auth0-react";

const center_div = {
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%,-50%)",
}

const formStyle = {
    extendLeft : '300px'
}

const ShowForm = () => {
    return (
        <div style={center_div} >
            <h3>Add a Vendor</h3>
            <form>
                <input placeholder="Vendor Name" style={formStyle}></input><br/><br/>
                <input placeholder="Bank Account No."></input><br/><br/>
                <input placeholder="Bank Name"></input><br/><br/>
                <input placeholder="addressLineOne"></input><br/><br/>
                <input placeholder="addressLineTwo"></input><br/><br/>
                <input placeholder="City"></input><br/><br/>
                <input placeholder="Country"></input><br/><br/>
                <input placeholder="Zip Code"></input><br/><br/>
            </form>
        </div>
    );
}

function AddVendor() {
    const { isAuthenticated } = useAuth0();
    return (
        <div>
            <Navbar />
            {
                !isAuthenticated ? <p>Please Login</p> :
                    <ShowForm />
            }
        </div>
    );
}

export default AddVendor;
